import React from "react";
const Data = [
  { title: "Tom and Jerry", genre: "Anime", stock: 8, rate: 7.8 },
  { title: "Die Hard", genre: "Action", stock: 18, rate: 7.6 },
  { title: "Conjuring", genre: "Horror", stock: 23, rate: 9 },
  { title: "Cars", genre: "Anime", stock: 5, rate: 6 },
];


export default Data;
